import React, { Component } from "react";
import axios from "axios";

import Header from "./Header.js"

import "../css/style.css"

class Webapp extends Component {
    constructor() {
        super();
        this.state = {
            feelings: [],
            boosts: [],
            activities: 
                [],
            feeling: "",
            boost: "",
            activity: "",
        }
    }

    componentWillMount() {
        axios.get('../data.json')
            .then(res => {
                this.setState({
                    feelings: res.data.feelings,
                    boosts: res.data.boosts,
                    activities: res.data.activities,
                })
            })
            .catch(function (error) {
                console.log(error);
            });
    }

    render() {

        const feelings = this.state.feelings.map((item, key) =>
            <div>

            </div>
        );

        const activity = this.state.activities.map((item, key) =>
            <div key={item.name}>
                {item.name}
            </div>
        );

        return (
            <div>
                <Header />
                <body>
                    <div className="div1">
                        <div className="text">
                            I WANT TO FEEL
                            <br />
                            <div className="selectText">
                                <b>
                                    {this.state.feeling === "" ? "Select Mood" : this.state.feeling}
                                </b>
                            </div>
                            <div className="overlay">
                                <div className="selector"> 
                                    Choose one: 

                                </div>
                            </div>
                        </div>
                    </div>
                    <div className="div2">
                        <div className="text">
                            AND BOOST MY 
                            <br />   
                            <div className="selectText">
                                <b>
                                    Select Mood
                                </b>
                            </div>
                            <div className="overlay">
                                <div className="selector"> 
                                    Choose one:
                                </div>
                            </div>                  
                        </div>                   
                    </div>
                    <div className="div3">
                        <div className="text">
                            WHILE I
                            <br />
                            <div className="selectText">
                                <b>
                                    Select Mood
                                </b>
                            </div>
                            <div className="overlay">
                                <div className="selector">
                                    Choose one: 
                                    {activity}
                                </div>
                            </div>                      
                        </div>       
                    </div>
                </body>
                <footer className="bg-light">
                    test height

                </footer>
            </div>
        )
    }
}

export default Webapp;
